	auto camrot = CAM::GET_GAMEPLAY_CAM_ROT(0);
	auto camdir = rot_to_direction(&camrot);
	auto start = ENTITY::GET_ENTITY_COORDS(WEAPON::GET_CURRENT_PED_WEAPON_ENTITY_INDEX(PLAYER::PLAYER_PED_ID()), 1);

