			sprintf_s(statNameFull, "SP%d_TOTAL_CASH", PLAYER::GET_PLAYER_PED_SCRIPT_INDEX);
			Hash hash = GAMEPLAY::GET_HASH_KEY(statNameFull);
			int val;
			STATS::STAT_GET_INT(hash, &val, -1);
			val += 5000;
			Hooking::stat_set_int(hash, val, 1);
